import {
  Button
} from "@mui/material";

import {
  cretateTheme,
  ThemeProvider
} from "@mui/material/styles";
import { red, cyan, yellow, amber} from "@mui/material/colors";
const MaterialColorTheme = ()=>{

  const colorPalate = createTheme({
    palette:{
      primary: red,
      secondary: cyan,
      error: yellow,
      info: amber
    }
  })

  const design = (
    <>
      <cretateTheme>
      <Button variant="contained" color="success">SUBMIT</Button>
      </cretateTheme>
    </>
  );
  return design;
}

export default MaterialColorTheme;
